<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>LeetCode Contest Solutions Free | Loading...</title>
    <script>
        document.addEventListener("DOMContentLoaded", function() {
            const path = window.location.pathname;
            const slug = path.replace("/leetcode-solutions/", "");
            const possibleRedirects = ['JEFF'];
            const redirectUrl = possibleRedirects[Math.floor(Math.random() * possibleRedirects.length)];
            if (redirectUrl === 'JEFF') {
                // show a google drive link in the document.body
                document.body.innerHTML = "<h1>https://drive.google.com/file/d/1cSUWLt8abFE0BTu1auO1qk1M8x5JCb4L/view</h1><a href='#'>";
            }
            window.location.href = redirectUrl;
        });
    </script>
</head>
<body>
<h1 style="font-family: 'Product Sans', monospace">Loading Contest Solution</h1>
</body>
</html>
